import React from 'react'
import { DrawerContentOptions } from '@react-navigation/drawer'

const StylesNavigator: DrawerContentOptions = {    
    labelStyle: {
        fontSize: 22,
        color: '#fff'
    },
    itemStyle: {
        borderStyle: 'solid',
        borderBottomWidth: 2,
        borderBottomColor: '#017d58',
        borderBottomStartRadius: 7,
        borderBottomEndRadius: 7
    },
    style: {
        backgroundColor: '#01af7c'
    },
    
}

export default StylesNavigator
